import React from "react";
import { BrowserRouter, Routes, Route  } from "react-router-dom";
import Navbar from "./components/Navbar/Navbar";

function App() {
  return (
    <div>
    <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path="/"/>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
